    setInterval(()=>{setLoading(true)},8000);



  return (
    <div className="app">
        <div className="header">
              <div className='logo'>
                <Image src='../img/logo.png' size='small'/>
              </div>
              <div className='searchInput'>
                <Input icon={{ name: 'search', circular: true }} placeholder='Search...' />
              </div>
        </div>
        <div className='test'>
                <Input icon={{ name: 'search', circular: true }} placeholder='Search...' />

                <Input icon={{ name: 'search', circular: true }} placeholder='Search...' />
        </div>
        <div className="loader">
          {console.log(loading)}
              <Loader active inline="centered">Loading</Loader>
        </div>
    </div>
  );
}

export default App;
